import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBars } from '@fortawesome/free-solid-svg-icons'

const Navbar = (props) => {

    React.useEffect(() => {

        function handleResize() {
            console.log("Resized")
        }


        window.addEventListener("resize", handleResize);
    }, [])

    return (
        <nav className="nav-bar">
            <FontAwesomeIcon icon={faBars} size="2xl" className="icon-fa-bar" />
            <ul className="nav-list">
                <li onClick={() => props.handlePage("register")}>Register</li>
                <li onClick={() => props.handlePage("login")}>Login</li>
                <li onClick={() => props.handlePage("dashboard")}>Dashboard</li>
                <li onClick={() => props.handlePage("parent-portal")}>Parent Portal</li>
            </ul>
        </nav>
    )
}

export default Navbar
